import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGlobe, faBars } from '@fortawesome/free-solid-svg-icons';
import './navbar.css';

function Navbar() {
  // State for toggling the first navbar menu
  const [isMenuOpen1, setIsMenuOpen1] = useState(false);
  // State for toggling the second navbar menu
  const [isMenuOpen2, setIsMenuOpen2] = useState(false);

  const handleMenuToggle1 = () => {
    setIsMenuOpen1(!isMenuOpen1);
  };

  const handleMenuToggle2 = () => {
    setIsMenuOpen2(!isMenuOpen2);
  };

  return (
    <div>
      {/* First Navbar */}
      <nav className="navbar">
        <div className='navbar1'>
          <div className='navbar-logo'>
            <h1>Business Solution</h1>
          </div>

          <div className='navbar-bars' onClick={handleMenuToggle1}>
            <FontAwesomeIcon icon={faBars} />
          </div>

          <ul className={`navbar-menu ${isMenuOpen1 ? 'active' : ''}`}>
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
            <li><FontAwesomeIcon icon={faGlobe} /> En</li>
          </ul>
        </div>
      </nav>

      {/* Second Navbar */}
      <nav className="navbar">
        <div className='navbar2'>
          <div className='navbar-bars' onClick={handleMenuToggle2}>
            <FontAwesomeIcon icon={faBars} />
          </div>

          <ul className={`navbar-menu2 ${isMenuOpen2 ? 'active' : ''}`}>
            <li>Products</li>
            <li>Solutions</li>
            <li>Customers</li>
            <li>Resources</li>
            <li>Contact us</li>
            <li>Get started</li>
          </ul>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
